import './settings.css';
import profileImage from '../../assets/rajesh.jpg';

export default function Settings() {
	return (
		<div className="settings">
			<div className="settingsWrapper">
				<div className="settingsTitle">
					<img className="settingsPP" src={profileImage} alt="" />
					<i className="settingsPPIcon fa-solid fa-user"></i>
				</div>
				<div className="settingsForm">
					<label htmlFor="">Username</label>
					<input type="text" placeholder="Rajesh" />
					<label htmlFor="">Email</label>
					<input type="text" placeholder="Rajeshsjk0@gmail.com" required />
					<label htmlFor="">Password</label>
					<input type="password" placeholder="password" required />
				</div>
				<div className="settingsSubmitButton">Update</div>
			</div>
		</div>
	);
}
